import React from "react";
import MainContainer from "./components/MainContainer";
import TopContainer from "./components/TopContainer";


const App = () => {

    const [className,setClassName] = React.useState('closed');

    const handleLogoClick = () => setClassName=(c => c === '' ? 'open' : '')

    return (
        <>
            <TopContainer onLogoClick={handleLogoClick} className={className}/>
            <MainContainer />
        </>
    )
}

export default App
